import firebase from './firebase'

export const signUp = (username, email, password) => {
  firebase.auth().createUserWithEmailAndPassword(email, password)
  console.log("It made me.")
  var ppl = {}
  ppl[0] = {name: username, email: email}
  db().doc(email).set({
    people: ppl,
    relationships: {}
  })
}
